บทนำ ~ Introduction
พวกเราส่วนใหญ่ มีประสบการณ์ชีวิตที่เต็มเปี่ยมไปด้วยช่วงเวลาอันน่าอัศจรรย์และช่วงเวลาที่ยากลำบาก ~ Most of us have experienced life filled with amazing times and difficult times.
แต่สำหรับอีกหลายคน ~ But for many others,
แม้จะอยู่ในช่วงเวลาเบิกบานที่สุด ~ even-though stay in time-period joyful most
ความกลัวก็ยังอยู่ตรงนั้น ~ fear still stay right there
ซ่อนตัวอยู่เบื้องหลังความเบิกบานของเรา ~ hiding behind joy of we
เรากลัวว่าช่วงเวลานี้จะสิ้นสุดลง ~ we afraid speak time-period this will end
เราจะไม่ได้รับสิ่งที่ต้องการ ~ we will cannot receive thing at need
เราจะสูญเสียสิ่งอันเป็นที่รัก ~ we will lose thing beloved
หรือเราอาจจะไม่ปลอดภัย ~ or we maybe not safe
บ่อยครั้งที่ความกลัวอันใหญ่หลวงเกิดจากการที่เรารู้ว่าสักวันหนึ่งร่างกายของเราจะหยุดทำงาน ~ often at fear greatest caused-by the-fact-that we know speak someday body of we will stop work
ดังนั้นแม้ว่าเราจะอยู่ท่ามกลางเงื่อนไขอันเพียบพร้อมเพื่อจะมีความสุข ~ so although we will stay in-the-middle-of condition complete for will have happiness
แต่ความสุขเบิกบานไม่เคยสมบูรณ์ ~ but happiness joyful never perfect



