ไม่ล่ะ ฉันไม่ต้องการคิดถึงสิ่งนั้น ~ No! I not need think of that thing.
เราพยายามเพิกเฉยต่อความกลัวของเรา ~ We try to ignore but fear,
แต่ความกลัวก็ยังคงอยู่ตรงนั้นเสมอ ~ but the fear still stays right there always.



