เรากลัวหลายอย่างที่อยู่ภายนอกตัวเราซึ่งสิ่งเหล่านั้นเราไม่อาจควบคุมได้ ~ We fear many things that are outside of ourselves, things we cannot control.
เรากังวลว่าเราจะต้องป่วย อายุมากขึ้น และสูญเสียหลาย ๆ สิ่งอันมีค่าของเราไป ~ We worry that we will be sick, become older, and lose many of our precious things.
เราพยายามที่จะยึดถือสิ่งต่าง ๆ ที่เราให้ความสำคัญ ~ We try to hold different things that we value,
ไม่ว่าจะเป็นตำแหน่งทรัพย์สมบัติ หรือแม้แต่คนที่เรารัก  ~ whether position, wealth, or even persons we love.
แต่การยึดถืออย่างเหนียวแน่นในสิ่งต่าง ๆ เหล่านั้นไม่ได้ช่วยให้ความกลัวสงบลงเลย ~ But abiding firmly in those things cannot help the fear settle down at all.
ที่สุดแล้ววันหนึ่งเราก็จะต้องปล่อยสิ่งต่าง ๆ เหล่านั้นไป ~ Ultimately then, one day we then will have to let those things go.
เราไม่สามารถนำสิ่งเหล่านั้นไปกับเราได้ ~ We are not able to take those things with us.










