เราอาจคิดว่าถ้าเราเพิกเฉยต่อความกลัวของเรา ~ We may think that if we ignore our fear,
ไม่นานมันก็จะหายไป ~ before long it will disappear.
แต่หากว่าเราฝังความกังวลและความกระวนกระวายไว้ใต้จิตรับรู้สิ่งนี้ก็ยังคงส่งผลกระทบและนำความเศร้ามาให้เรามากขึ้น ~ But if we bury our worry and anxiety under our mind, this will continue to affect and bring us more sadness.
เรากลัวอย่างยิ่งที่จะกลายเป็นคนหมดพลังอำนาจ ~ We are extremely afraid to become a powerless person.
แต่ที่จริงแล้วเรามีพลังที่จะมองอย่างลึกซึ้งเข้าไปในความกลัวของเรา ~ But in truth, already we have the power to look deeply into the fear.
แล้วความกลัวนั้นก็จะควบคุมเราไม่ได้อีกต่อไป ~ Then that fear will control us no longer.
เราสามารถแปรเปลี่ยนความกลัวของเราได้ ~ We are able to change our fear.
การฝึกดำเนินชีวิตอย่างเต็มเปี่ยมในปัจจุบันขณะที่เราเรียกว่า "สติ" ~ Practicing living life fully in the present moment, that we call "mindfulness"
สามารถสร้างความกล้าหาญให้แก่เราในการเผชิญหน้ากับความกลัว ~ is able to build courage for us in confrontation with fear
และไม่คอยผลักไสยื้อยุดกับความกลัวนั้นอีก ~ and not continue to push away and hold back with fear that again.
การมีสติหมายถึงการมองอย่างลึกซึ้งเพื่อสัมผัสธรรมชาติที่แท้จริงของการเป็นดั่งกันและกัน ~ Having mindfulness means looking deeply to touch the true nature of being like one another,
และรับรู้ได้ว่าไม่มีสิ่งไดเลยที่จะหายไป ~ and get to know that nothing at all will disappear.













