วันหนึ่งในช่วงสงครามเวียดนาม
ขณะที่ฉันกำลังนั่งรอเครื่องบินอยู่ในลานบินว่างเปล่าบริเวณที่ราบสูงของเวียดนามเพื่อเดินทางไปภาคเหนือเพื่อลงพื้นที่รับรู้สถานการณ์น้ำท่วมและให้ความช่วยเหลือบรรเทาทุกข์แก่ผู้ประสบภัย
เนื่องจากเป็นสถานการณ์เร่งด่วนจึงจำเป็นต้องใช้เครื่องบินของกองทัพึ่งโดยปกติใช้สำหรับการขนส่งสิ่งของต่างๆ
อย่างผ้าห่มและเสื้อผ้า
ฉันนั่งรอเครื่องบินลำถัดไปอยู่คนเดียวในลานบินนั้นเมื่อเจ้าหน้าที่ชาวอเมริกันคนหนึ่งมาถึง
เขาก็นั่งรอเครื่องบินด้วยเช่นกันขณะนั้นอยู่ในช่วงสงครามและมีเพียงเราสองคนที่ลานบินนั้น
ฉันมองไปที่เขาและเห็นว่าเขาอายุยังน้อย
ทันไดนั้น
ฉันรู้สึกเห็นใจเขามาก
ทำไมเขาต้องมาอยู่ที่นี่เพื่อฆ่าหรือถูกฆ่าด้วยเล่า
ด้วยความเห็นใจเช่นนั้น
ฉันจึงพูดกับเขาว่า
"เธอคงจะกลัวเวียดกงอย่างมาก"
(เวียดกง คือ กลุ่มกองโจรคอมมิวนิสต์ของเวียดนาม)
โชคไม่ดีที่ฉันไม่มีทักษะในการพูดที่ดีเท่าไหร่นักสิ่งที่ฉันพูดจึงไปรดน้ำเมล็ดพันธุ์ความกลัวในตัวเขา
เขากุมปืนของเขาไว้ทันทีและถามฉันว่า
